中村 孝則 on Instagram: "佐渡島の南端の港町、小木の港町にあるレストラン「origine(オリジヌ)」訪問。オリジヌは、新潟県中越・柏崎ご出身の伊藤薫さんが、2023年4月にオープンさせた。小木漁港に面した古民家を改造した店内は、カウンター席のみの小さなレストランだが、その噂は口コミでフーディにも広がり、島内だけでなく県外からのゲストも訪れはじめている。伊藤薫さんは、父親が柏崎の深山で平場での養鶏所を営む両親のもと、豊かな食材の中で育ち、それがきっかけで料理人の道へ。都内や箱根のフレンチレストランなどで修業の後、独立を決意。その場所を、食材や風土の豊かな佐渡島のこの場所に決めた。ゆえに、食材のほぼ全ては佐渡産である。経営スタイルも独特で、コース料理のディナーと曜日を限定した朝食のみである。私が今宵いただいたディナーの料理は、佐渡産の牡蠣のポタージュ、佐渡産の野菜の温菜、佐渡で水揚げされたタラ、そして貴重な佐渡牛の藁焼きである。食材のほとんどは佐渡島内で佐藤さんが直接仕入れる、または自家栽培の野菜やハーブで構成されている。例えば、年間30頭あまりしか出荷されない佐渡牛は、佐渡の稲藁を食べ育つというが、火入れはその佐渡の藁で行い、ソースには佐渡のトチノキの蜂蜜を使い、佐渡の山の黒ラッパ茸が添えられる。どの料理も、シンプルな調理で仕上げ、素材の素性を深ぐる楽しみを与えてくれる。宵の口の静かな島の漁港のタングステンの光の店内で、一皿ひとさらに向き合っていると、島の空気感と一体になったような詩的な気分に入り混んでいくようでもある。ここの料理だけを目的に佐渡島に来ても、島の魅力と満ち足りた時間を感じることのできる店である。

